import React, { Component } from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

import UploadFile from './UploadFile';
import Home from './Home';
import UploadMultipleFiles from './UploadMultipleFiles';
import TestAPI from './TestAPI';
import Signin from './Signin';
import TestDraw from './test_draw';
import SignUp from './SignUp';
import TestSignUp from './TestSignUp';
import CustomRouting from './CustomRouting';
import Error from './Error';
import TestCookie from './Test_Cookies';
// Routes for the webpages in the project


class Routes extends Component {

  componentDidMount(){
  // OnLoad function
    const cookies = new Cookies()

    if(cookies.get('username') == "Pacman"){
      this.DataRetrieved.innerHTML = cookies.get('username')
      this.props.history.push({
        pathname: '/customrouting',
        state: {usercredentials: this.usercredentials.value,checkval : "Yes"}
      })
    }else{
      console.log("No cookie")
    }
  }

  render() {
    return (
       <BrowserRouter>
        <div>
          <Switch />
            <Switch>
             <Route exact path="/" component={Home} />
             <Route path="/customrouting" component = {CustomRouting} />
             <Route path="/signup" component = {SignUp} />
             <Route path="/signin" component= {Signin} />
             <Route path="/testapi" component={TestAPI} />
             <Route path ="/testcookie" component = {TestCookie} />
             <Route component={Error} />
           </Switch>
        </div>
      </BrowserRouter>
    );
  }
}

export default Routes;
